  (2003 LIDAR) and customized boundaries based on contours, drainage infrastructure,
  COA Plans, and staff knowledge. This data was created in October 2007. The attributes
  identify the watershed in which contributing area resides and whether each contributing
  area is East or West of the Recharge Zone. This data has been produced by the City
  of Austin for the sole purpose of aiding internal processes and is not warranted
  for any other use. No warranty is made by the City of Austin regarding its accuracy
